import React from "react";
import "./style/card.css"

const Card = props => (
    <div>
        <div className="card">
            <div className="img-container">
                <img alt={props.name} src={props.image} />
            </div>
        </div>
        <div className="card">
            <img className="card-img-top" src={props.image} alt="Card"/>
        </div>
    </div>
);

export default Card;
